import React from "react";
import styled from "styled-components";
import { Icon } from "./svg/Icon";

const MenuConteiner = styled.div`
  font-family: "TTFirsNeue400";
  margin: 47px auto 0;
  margin-bottom: -16px;
  width: 647px;
  height: 17px;
  display: flex;
  justify-content: space-between;
  @media (max-width: 768px) {
    display: none;
  }
`;

const LeftMenuArrow = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
`;

const RightMenuArrow = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
`;

export default function HeaderMenu() {
  return (
    <div>
      <MenuConteiner>
        <Icon id="headerArrow" className="arrow-icon" />
        <Icon id="headerArrow" className="arrow-icon right" />
      </MenuConteiner>
    </div>
  );
}
